-- ----------------------------
-- Procedure structure for `del_data`
-- ----------------------------
DROP PROCEDURE IF EXISTS `del_data`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `del_data`()
BEGIN
    DELETE FROM error_log_info WHERE create_date < DATE_SUB(CURDATE(),INTERVAL 3 MONTH);
END
;;
DELIMITER ;

-- ----------------------------
-- Event structure for `del_event`
-- ----------------------------
DROP EVENT IF EXISTS `del_event`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` EVENT `del_event` ON SCHEDULE EVERY 1 DAY STARTS '2020-02-12 00:00:00' ON COMPLETION NOT PRESERVE ENABLE DO call del_data()
;;
DELIMITER ;
